import React from 'react'
import { useEffect, useState } from 'react'
import ImageService from '../Services/ImageService';
import Wallpaper from './Wallpaper';
import Masonry, {ResponsiveMasonry} from "react-responsive-masonry"

const Wallpapers = () => {

    const[images,setImages]=useState([]);
    const[loading,setLoading]=useState(true);

    useEffect(()=>{
        const fetchData=async()=>
        {
            setLoading(true);
            try{

                const response=await ImageService.getImages();
                //console.log(response.data)
                setImages(response.data);
            }catch(error)
            {
                console.log(error);
            }
            setLoading(false);
        };
        fetchData();

    },[]);

  return (

    <>

    <div className='px-20 py-10 h-13'>
        <div>
        <div className='relative w-full    ' >

        
        <img className='w-full  h-auto ' src='https://cdn.pixabay.com/photo/2016/04/15/14/07/sunset-1331088_960_720.jpg'/>
        <div className='text-white top-1/2 text-xl text-center font-sans absolute'>WallpaperHub</div>
        </div>

        </div>     
    </div>



    <div className='px-20 py-10 '>
        
    <ResponsiveMasonry
                    columnsCountBreakPoints={{350: 1, 750: 2, 900: 3}}
                >
                    <Masonry gutter='20px'>
                        {images.map((image) => (
                            <Wallpaper image={image} key={image.id}/>
                           
                        ))}
                    </Masonry>
            </ResponsiveMasonry>



    </div>
    </>
  )
}

export default Wallpapers
